    t[141] = "\u042d\u0442\u043e\u0442 \u0430\u0434\u0440\u0435\u0441 \u0431\u0443\u0434\u0435\u0442 \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d \u0432 \u0430\u0434\u0440\u0435\u0441\u043d\u0443\u044e \u043a\u043d\u0438\u0433\u0443 \u0432\u0430\u0448\u0435\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430, \u0433\u0434\u0435 \u0445\u0440\u0430\u043d\u044f\u0442\u0441\u044f \u0430\u0434\u0440\u0435\u0441\u0430 \u0438\u0437 \u043f\u043e\u0434\u043f\u0438\u0441\u043e\u043a.";
    t[144] = "This seems to be a bad destination:";
    t[145] = "\u041f\u043e\u0445\u043e\u0436\u0435, \u044d\u0442\u043e \u043f\u043b\u043e\u0445\u043e\u0439 \u0430\u0434\u0440\u0435\u0441 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f:";
    t[148] = "Check your URL to try and fix the helper key to be a valid Base 32 hostname or Base 64 key.";
    t[149] = "\u041f\u0440\u043e\u0432\u0435\u0440\u044c\u0442\u0435 URL \u0438 \u043f\u043e\u043f\u0440\u043e\u0431\u0443\u0439\u0442\u0435 \u0438\u0441\u043f\u0440\u0430\u0432\u0438\u0442\u044c \u0441\u0441\u044b\u043b\u043a\u0443 \u0441 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u043a\u043e\u0440\u0440\u0435\u043a\u0442\u043d\u043e\u0439 \u0441\u0441\u044b\u043b\u043a\u0438 Base32 \u0438\u043b\u0438 Base64.";
    t[152] = "The I2P HTTP Proxy supports HTTP and HTTPS requests only.";
    t[153] = "I2P HTTP \u043f\u0440\u043e\u043a\u0441\u0438 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u0435\u0442 \u0442\u043e\u043b\u044c\u043a\u043e HTTP \u0438 HTTPS \u0437\u0430\u043f\u0440\u043e\u0441\u044b.";
    t[156] = "Proxy Authorization Required";
    t[157] = "\u0410\u0432\u0442\u043e\u0440\u0438\u0437\u0430\u0446\u0438\u044f outproxy";
    t[160] = "You attempted to connect to a non-I2P website or location.";
    t[161] = "\u0412\u044b \u043f\u043e\u043f\u044b\u0442\u0430\u043b\u0438\u0441\u044c \u0441\u043e\u0435\u0434\u0438\u043d\u0438\u0442\u044c\u0441\u044f \u0441 \u0441\u0430\u0439\u0442\u043e\u043c \u043d\u0435 \u0432 \u0441\u0435\u0442\u0438 I2P.";
    t[162] = "The website was not found in your router's addressbook.";
    t[163] = "\u0421\u0430\u0439\u0442 \u043d\u0435 \u043d\u0430\u0439\u0434\u0435\u043d \u0432 \u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0435 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430.";
    t[164] = "Address Book";
    t[165] = "\u0410\u0434\u0440\u0435\u0441\u043d\u0430\u044f \u043a\u043d\u0438\u0433\u0430";
    t[168] = "Base32 address decryption failure, check encryption key";
    t[169] = "\u0421\u0431\u043e\u0439 \u0440\u0430\u0441\u0448\u0438\u0444\u0440\u043e\u0432\u043a\u0438 Base32-\u0430\u0434\u0440\u0435\u0441\u0430, \u043f\u0440\u043e\u0432\u0435\u0440\u044c\u0442\u0435 \u043a\u043b\u044e\u0447 \u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0438\u044f";
    t[170] = "Outproxy Unreachable";
    t[171] = "\u0412\u043d\u0435\u0448\u043d\u0438\u0439 \u043f\u0440\u043e\u043a\u0441\u0438 \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u0435\u043d";
    t[172] = "If you do not wish to visit this host, click the \"back\" button on your browser.";
    t[173] = "\u0415\u0441\u043b\u0438 \u0432\u044b \u043d\u0435 \u0445\u043e\u0442\u0438\u0442\u0435 \u043f\u043e\u0441\u0435\u0449\u0430\u0442\u044c \u044d\u0442\u043e\u0442 \u0441\u0430\u0439\u0442, \u043d\u0430\u0436\u043c\u0438\u0442\u0435 \u043a\u043d\u043e\u043f\u043a\u0443 \u00ab\u041d\u0430\u0437\u0430\u0434\u00bb \u0432 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0435.";
    t[182] = "You may want to {0}retry{1}.";
    t[183] = "\u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 {0}\u043f\u043e\u0432\u0442\u043e\u0440\u0438\u0442\u044c{1} \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435.";
    t[190] = "It is offline, there is network congestion, or your router is not yet well-integrated with peers.";
    t[191] = "\u0412\u043e\u0437\u043c\u043e\u0436\u043d\u043e, \u043e\u043d \u043e\u0442\u043a\u043b\u044e\u0447\u0451\u043d, \u0441\u0435\u0442\u044c \u043f\u0435\u0440\u0435\u0433\u0440\u0443\u0436\u0435\u043d\u0430 \u0438\u043b\u0438 \u0432\u0430\u0448 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043d\u0435\u0434\u043e\u0441\u0442\u0430\u0442\u043e\u0447\u043d\u043e \u0438\u043d\u0442\u0435\u0433\u0440\u0438\u0440\u043e\u0432\u0430\u043d \u0441 \u0434\u0440\u0443\u0433\u0438\u043c\u0438 \u0443\u0437\u043b\u0430\u043c\u0438.";
    t[202] = "Your request was for a site outside of I2P, but you have no HTTP outproxy configured.";
    t[203] = "\u0412\u044b \u0437\u0430\u043f\u0440\u043e\u0441\u0438\u043b\u0438 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0443 \u0432\u043d\u0435 \u0441\u0435\u0442\u0438 I2P, \u043d\u043e \u043d\u0435 \u0438\u043c\u0435\u0435\u0442\u0435 \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u0432\u044b\u0445\u043e\u0434\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u043a\u0441\u0438-\u0441\u0435\u0440\u0432\u0435\u0440\u0430.";
    t[204] = "Resolve the conflict by deciding which key you trust, and then either ignore the address helper link, or delete the host entry from your address book and click the address helper link again.";
    t[205] = "\u0414\u043b\u044f \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u0438\u044f \u043a\u043e\u043d\u0444\u043b\u0438\u043a\u0442\u0430 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0438\u0442\u0435, \u043a\u0430\u043a\u043e\u043c\u0443 \u043a\u043b\u044e\u0447\u0443 \u0432\u044b \u0434\u043e\u0432\u0435\u0440\u044f\u0435\u0442\u0435, \u0438 \u043b\u0438\u0431\u043e \u043e\u0442\u043a\u0430\u0436\u0438\u0442\u0435\u0441\u044c \u043e\u0442 \u043f\u0440\u043e\u0445\u043e\u0434\u0430 \u043f\u043e \u0441\u0441\u044b\u043b\u043a\u0435, \u043b\u0438\u0431\u043e \u0443\u0434\u0430\u043b\u0438\u0442\u0435 \u0441\u0442\u0430\u0440\u044b\u0439 \u043a\u043b\u044e\u0447 \u0438 \u043f\u0435\u0440\u0435\u0439\u0434\u0438\u0442\u0435 \u043f\u043e \u0441\u0441\u044b\u043b\u043a\u0435 \u0441\u043d\u043e\u0432\u0430.";
    t[212] = "Could not connect to the following destination:";
    t[213] = "\u041d\u0435 \u0443\u0434\u0430\u043b\u043e\u0441\u044c \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u044c\u0441\u044f \u043a \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u043c\u0443 \u0430\u0434\u0440\u0435\u0441\u0443:";
    t[214] = "You must either enter a PSK encryption key provided by the server operator, or generate a DH encryption key and send that to the server operator.";
    t[215] = "\u0412\u044b \u0442\u0430\u043a\u0436\u0435 \u0434\u043e\u043b\u0436\u043d\u044b \u0432\u0432\u0435\u0441\u0442\u0438 PSK-\u043a\u043b\u044e\u0447 \u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0438\u044f, \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u043c\u044b\u0439 \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u043e\u0440\u043e\u043c \u0441\u0435\u0440\u0432\u0435\u0440\u0430, \u0438\u043b\u0438 \u0441\u0430\u043c\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u043e \u0441\u0433\u0435\u043d\u0435\u0440\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u0441\u0430\u043c DH-\u043a\u043b\u044e\u0447 \u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0438\u044f \u0438 \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u0442\u044c \u0435\u0433\u043e \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u043e\u0440\u0443 \u0441\u0435\u0440\u0432\u0435\u0440\u0430.";
    t[216] = "The address helper link you followed is for a new host name that is not in your address book.";
    t[217] = "\u0421\u0441\u044b\u043b\u043a\u0430 \u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0433\u043e \u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a\u0430, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0432\u044b \u043f\u0435\u0440\u0435\u0448\u043b\u0438, \u0432\u0435\u0434\u0451\u0442 \u043d\u0430 \u0434\u043e\u043c\u0435\u043d, \u043d\u0435 \u0432\u043d\u0435\u0441\u0451\u043d\u043d\u044b\u0439 \u0432 \u0430\u0434\u0440\u0435\u0441\u043d\u0443\u044e \u043a\u043d\u0438\u0433\u0443.";
    t[218] = "Someone could be trying to impersonate another website, or people have given two websites identical names.";
    t[219] = "\u0412\u043e\u0437\u043c\u043e\u0436\u043d\u043e, \u043a\u0442\u043e-\u0442\u043e \u043f\u044b\u0442\u0430\u0435\u0442\u0441\u044f \u0432\u044b\u0434\u0430\u0442\u044c \u0441\u0435\u0431\u044f \u0437\u0430 \u0434\u0440\u0443\u0433\u043e\u0439 \u0441\u0430\u0439\u0442 \u0438\u043b\u0438 \u0440\u0430\u0437\u043d\u044b\u0435 \u043b\u044e\u0434\u0438 \u0434\u0430\u043b\u0438 \u0434\u0432\u0443\u043c \u0441\u0430\u0439\u0442\u0430\u043c \u043e\u0434\u0438\u043d\u0430\u043a\u043e\u0432\u044b\u0435 \u0438\u043c\u0435\u043d\u0430.";
    t[220] = "Missing private key";
    t[221] = "\u041f\u0440\u043e\u043f\u0443\u0449\u0435\u043d \u0447\u0430\u0441\u0442\u043d\u044b\u0439 \u043a\u043b\u044e\u0447";
    t[230] = "Please configure an outproxy in I2PTunnel.";
    t[231] = "\u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043d\u0430\u0441\u0442\u0440\u043e\u0439\u0442\u0435 \u0432\u044b\u0445\u043e\u0434\u043d\u043e\u0439 \u043f\u0440\u043e\u043a\u0441\u0438-\u0441\u0435\u0440\u0432\u0435\u0440 \u0432 I2PTunnel.";
    t[232] = "Please enter your username and password, or check your {0}router configuration{1} or {2}I2PTunnel configuration{3}.";
    t[233] = "\u0412\u0432\u0435\u0434\u0438\u0442\u0435 \u0438\u043c\u044f \u0438 \u043f\u0430\u0440\u043e\u043b\u044c \u0438\u043b\u0438 \u043f\u0440\u043e\u0432\u0435\u0440\u044c\u0442\u0435 \u0432\u0430\u0448\u0438 {0}\u043d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430{1} \u0438 {2}\u043d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438 I2PTunnel{3}.";
    t[236] = "Added via address helper from {0}";
    t[237] = "\u0414\u043e\u0431\u0430\u0432\u043b\u0435\u043d\u043e \u0447\u0435\u0440\u0435\u0437 \u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0433\u043e \u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a\u0430 \u0438\u0437 {0}";
    t[238] = "Configuration";
    t[239] = "\u041d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438";
    t[242] = "Conflicting address helper destination";
    t[243] = "\u041a\u043e\u043d\u0444\u043b\u0438\u043a\u0442\u0443\u044e\u0449\u0438\u0435 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0433\u043e \u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a\u0430";
    t[246] = "The outproxy is probably down, but there could also be network congestion.";
    t[247] = "\u0412\u043d\u0435\u0448\u043d\u0438\u0439 \u043f\u0440\u043e\u043a\u0441\u0438, \u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e, \u0432\u044b\u043a\u043b\u044e\u0447\u0435\u043d, \u043d\u043e \u0442\u0430\u043a\u0436\u0435 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u0430 \u043f\u0435\u0440\u0435\u0433\u0440\u0443\u0437\u043a\u0430 \u0441\u0435\u0442\u0438";
    t[250] = "Continue without saving";
    t[251] = "\u041f\u0440\u043e\u0434\u043e\u043b\u0436\u0438\u0442\u044c \u0431\u0435\u0437 \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u044f";
    t[256] = "Warning: No Outproxy Configured";
    t[257] = "\u041f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435: \u0432\u044b\u0445\u043e\u0434\u043d\u043e\u0439 \u043f\u0440\u043e\u043a\u0441\u0438-\u0441\u0435\u0440\u0432\u0435\u0440 \u043d\u0435 \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043d";
    t[260] = "Addressbook";
    t[261] = "\u0410\u0434\u0440\u0435\u0441\u043d\u0430\u044f \u043a\u043d\u0438\u0433\u0430";
    t[266] = "Information: New Host Name";
    t[267] = "\u0421\u0432\u0435\u0434\u0435\u043d\u0438\u044f: \u041d\u043e\u0432\u044b\u0439 \u0434\u043e\u043c\u0435\u043d\u043d\u044b\u0439 \u0430\u0434\u0440\u0435\u0441";
    t[276] = "Seeing this page often? See {0}the FAQ{1} for help in {2}adding some subscriptions{3} to your addressbook.";
    t[277] = "\u0415\u0441\u043b\u0438 \u0432\u044b \u0441\u043b\u0438\u0448\u043a\u043e\u043c \u0447\u0430\u0441\u0442\u043e \u043f\u043e\u043f\u0430\u0434\u0430\u0435\u0442\u0435 \u043d\u0430 \u044d\u0442\u0443 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0443, \u0442\u043e \u043e\u0431\u0440\u0430\u0442\u0438\u0442\u0435\u0441\u044c \u043a {0}\u0427\u0410\u0412\u041e{1} \u0437\u0430 \u0438\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u044f\u043c\u0438 \u043f\u043e {2}\u0434\u043e\u0431\u0430\u0432\u043b\u0435\u043d\u0438\u044e \u043f\u043e\u0434\u043f\u0438\u0441\u043e\u043a{3} \u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0438.";
    t[286] = "Saved the authentication for {0}, redirecting now.";
